import { Avatar, Box, Button, Stack, Typography } from '@mui/material'
import React from 'react'
import Theme from './Theme'
import img from '/media/nipuna/SSD FILES/Git Test/Medi-Ward-Sri-Lanka/src/Assest/mainlogo.png'

const theme=Theme();

export default function Sidebar() {
  return (
    <Box>
      <Stack justifyContent="center" alignItems="center">
        <Box sx={{
            marginBottom:"30px",
            marginTop:"30px",
        }}><Button variant="text">
                <Avatar sx={{
                width:100,
                height:100,
                backgroundColor:theme.palette.background.paper,
                }} alt="Remy Sharp" src={img} 

                />
            </Button>
        </Box>
        <Box sx={{width:"100%",

                }}>
            <Button  variant="outlined" sx={{
                width:"100%",
                height:90,
                borderBlockColor:theme.palette.primary.dark,
                "&:hover":{
                    backgroundColor:theme.palette.secondary.main,
                }

            }}><Typography variant="h5" sx={{color:theme.palette.background.normal,
                [theme.breakpoints.down("sm")]:{
                    fontSize:"16px"
                }
            }}>Add Ward Details</Typography></Button>
        </Box>

        <Box sx={{width:"100%",

        }}>
            <Button variant="outlined" sx={{
                width:"100%",
                height:90,
                borderBlockColor:theme.palette.primary.dark,
                "&:hover":{
                    backgroundColor:theme.palette.secondary.main,
                }

            }}><Typography variant="h5" 
            sx={{
                color:theme.palette.background.normal,
                [theme.breakpoints.down("sm")]:{
                    fontSize:"16px"
                }
                }}>
                    Home
                </Typography>
            </Button>
        </Box>

        <Box sx={{width:"100%",

        }}>
            <Button variant="outlined" sx={{
                width:"100%",
                height:90,
                borderBlockColor:theme.palette.primary.dark,
                "&:hover":{
                    backgroundColor:theme.palette.secondary.main,
                },




            }}><Typography variant="h5" 
            sx={{
                color:theme.palette.background.normal,
                [theme.breakpoints.down("sm")]:{
                    fontSize:"16px"
                }
                }}>
                    Leave Approve
                </Typography>
            </Button>
        </Box>

        <Box sx={{
            width:"100%",
        }}>
            <Button variant="outlined" sx={{
                width:"100%",
                height:90,
                borderBlockColor:theme.palette.primary.dark,
                "&:hover":{
                    backgroundColor:theme.palette.secondary.main,
                }

            }}><Typography variant="h5" 
            sx={{
                color:theme.palette.background.normal,
                [theme.breakpoints.down("sm")]:{
                    fontSize:"16px"
                }
                }}>
                    Scheduling
                </Typography>
            </Button>
        </Box>

        <Box sx={{
            width:"100%",
        }}>
            <Button variant="outlined" sx={{
                width:"100%",
                height:90,
                borderBlockColor:theme.palette.primary.dark,
                "&:hover":{
                    backgroundColor:theme.palette.secondary.main,
                }

            }}><Typography variant="h5" 
            sx={{
                color:theme.palette.background.normal,
                [theme.breakpoints.down("sm")]:{
                    fontSize:"16px"
                }
                }}>
                    Request Leave

                </Typography>
            </Button>
        </Box>

        <Box sx={{
            width:"100%",
        }}>
            <Button variant="outlined" sx={{
                width:"100%",
                height:90,
                borderBlockColor:theme.palette.primary.dark,
                "&:hover":{
                    backgroundColor:theme.palette.secondary.main,
                }

            }}>
                <Typography variant="h5" 
                sx={{
                    color:theme.palette.background.normal,
                    [theme.breakpoints.down("sm")]:{
                        fontSize:"16px"
                    }
                    }}>
                        Medicine
                </Typography>
            </Button>
        </Box>

        <Box sx={{
            width:"100%",
        }}>
            <Button variant="outlined" sx={{
                width:"100%",
                height:90,
                borderBlockColor:theme.palette.primary.dark,
                "&:hover":{
                    backgroundColor:theme.palette.secondary.main,
                }

            }}>
                <Typography variant="h5" 
                sx={{
                    color:theme.palette.background.normal,
                    [theme.breakpoints.down("sm")]:{
                        fontSize:"16px"
                    }
                    }}>
                        News
                </Typography>
            </Button>
        </Box>


      </Stack>
    </Box>
  )
}
